$(function(){

    $(window).scroll(function () {
        if ($(window).scrollTop() > 300) {
            $(".back-to-top").fadeIn(500);
        }
        else {
            $(".back-to-top").fadeOut(500);
        }
    });
    $('.hamburger').on('click',function(){
        $('.mobile-menu').addClass('mobile-menu-transform');
        $('.mobile-menu').css('transform','translateX(0)')
    })
    $('.menu-close').on('click',function(){
        $('.mobile-menu').removeClass('mobile-menu-transform');
        $('.mobile-menu').css('transform','translateX(100%)')
    })
    $(".back-to-top").click(function () {
        $('body,html').animate({scrollTop: 0}, 100);
        return false;
    });
    $('.small-nav li').on('click',function(){
        $(this).addClass('li-active').siblings().removeClass('li-active')
        let item = $(this).attr('data-name');
        $('.product-box').hide();
        $('.'+item).show();
    });
    $('.item-icon .iconfont').hover(function(){
        $(this).find('.iconfont-account').show();
    },function(){
        $(this).find('.iconfont-account').hide();
    })
})


window.onload=function(){
    $('#loading').hide();
};
var floor1Init = false,
box2Elemets = $('.box-b');
$(function(){



    var bannerSwiper = new Swiper('.banner-swiper', {
        spaceBetween: 30,
        centeredSlides: true,
        autoplay: {
            delay: 2500,
            disableOnInteraction: false,
        },
        pagination: {
            el: '.swiper-pagination',
            clickable: true,
        },
        navigation: {
            nextEl: '.swiper-button-next',
            prevEl: '.swiper-button-prev',
        },
    });
    device();


    $.each(box2Elemets, function () {
        $(this).attr('init', 'false');
    });

    $(document).scroll(function () {
        animateInit();
    });

})
function animateBot(item, time, callback) {
    if($(item).attr('init') == 'false'&& isScrolledIntoView($(item).parent())){
        $(item).attr('init', 'true');
        for(let i=1;i<$(item).length+1;i++){
            $('.cur'+i).delay(time*(i/2)).animate({'bottom': '0'}, 3000, 'easeOutCubic', callback)
        }
    }

}


function isScrolledIntoView(elem) {
    var docViewTop = $(window).scrollTop();
    var docViewBottom = docViewTop + $(window).height();
    var elemTop = $(elem).offset().top;
    if (elemTop + 50 < docViewBottom) {
        return true
    } else {
        return false
    }
}
function animateInit(){
    if (!floor1Init) {
        animateBot('.box-b', 500);
    }

}

//
function device(){
    var sUserAgent = navigator.userAgent.toLowerCase();
    var bIsIpad = sUserAgent.match(/ipad/i) == "ipad";
    var bIsIphoneOs = sUserAgent.match(/iphone os/i) == "iphone os";
    var bIsMidp = sUserAgent.match(/midp/i) == "midp";
    var bIsUc7 = sUserAgent.match(/rv:1.2.3.4/i) == "rv:1.2.3.4";
    var bIsUc = sUserAgent.match(/ucweb/i) == "ucweb";
    var bIsAndroid = sUserAgent.match(/android/i) == "android";
    var bIsCE = sUserAgent.match(/windows ce/i) == "windows ce";
    var bIsWM = sUserAgent.match(/windows mobile/i) == "windows mobile";

    if (!(bIsIpad || bIsIphoneOs || bIsMidp || bIsUc7 || bIsUc || bIsAndroid || bIsCE || bIsWM)) {

        $('.img-swiper').css('display','block');
        var imgSwiper = new Swiper('.img-swiper', {
            slidesPerView: 'auto',
            spaceBetween: 30,
            pagination: {
                el: '.swiper-pagination',
                clickable: true,
            },
            navigation: {
                nextEl: '.swiper-button-next',
                prevEl: '.swiper-button-prev',
            },
        });
    }else{
        $('.mobile-img-swiper').css('display','block');
        var mobileImgSwiper = new Swiper('.mobile-img-swiper', {
            slidesPerView: 'auto',
            centeredSlides: true,
            loop:true,
            spaceBetween: 0,

        });


    }
}
